fromString.haxe_doc:
Allocate a pointer for the string given.
		@param text The string to allocate for.
		@return The pointer allocated.

get.haxe_doc:
Get this pointer as a certain type at the offset given.
		@param type The type to get the pointer as.
		@param offset The offset to add to this pointer.
		@return The content of this pointer.

getBytes.haxe_doc:
Get this pointer as a bytes with the length specified.
		@param length The length of the bytes to get.
		@return The bytes.

createStruct.haxe_doc:
Creates a struct with the specified elements
		@param elements The elements of the struct.
		@return The struct type created.

match.haxe_doc:
Matches enum instance `e` against pattern `pattern`, returning true if
		matching succeeded and false otherwise.

		Example usage:

		```
		if (e.match(pattern)) {
			// codeIfTrue
		} else {
			// codeIfFalse
		}
		```

		This is equivalent to the following code:

		```
		switch (e) {
			case pattern:
				// codeIfTrue
			case _:
				// codeIfFalse
		}
		```

		This method is implemented in the compiler. This definition exists only
		for documentation.
